import React, { Component } from 'react';

export default class Nav extends Component {

    homeTExt() {
        document.getElementById("Change").innerHTML="HOME";
    }
    whoTExt() {
        document.getElementById("Change").innerHTML="QUI SUIS-JE?";
    }
    workTExt() {
        document.getElementById("Change").innerHTML="MES TRAVAUX";
    }
    contactTExt() {
        document.getElementById("Change").innerHTML="ME CPN";
    }
    blankText() {
        document.getElementById("Change").innerHTML=" ";
    }

    render() {
        return (
            <nav id="navBar">
                <a href="#Home"><i className="fas fa-home fa-2x" id="FirstIcon" onMouseOver={() => this.homeTExt()} onMouseOut={() => this.blankText()}></i></a>
                <a href="#Me"><i className="fas fa-user-check fa-2x" id="SecondIcon" onmouseover="whoText()" onmouseout="blankText()"></i></a>
                <a href="#myWorks"><i className="fas fa-laptop-code fa-2x" id="ThirdIcon" onmouseover="workText()" onmouseout="blankText()"></i></a>
                <a href="#mySocial"><i className="fas fa-handshake fa-2x" id="FourthIcon" onmouseover="contactText()" onmouseout="blankText()"></i></a>
                <article>
                    <h3 className="changingText" id="Change"></h3>
                </article>
            </nav>
        );
    }
}
